import React from "react";
import myPic from "../images/me 1.jpeg";
export default function About() {
  return (
    <div className="flex flex-col text-center space-y-8 p-8">
      <h3 className="text-center text-lg">About</h3>
      <h1 className="font-serif text-2xl">
        Developing <span className="italic capitalize">top class</span> websites
        using modern tech!
      </h1>
      <p className="text-md text-gray-500">
        I'm Wajahat, ethusiastic about new technology that we are envolved made
        me dig deeper into web development which I felt in love with
      </p>
      <img className="rounded-xl" src={myPic} alt="profilePicture" />
    </div>
  );
}
